import React, {Component} from 'react';

export default class labelContainer extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <section className={'label_container'}>
                <span className={'label'}>
                    {this.props.label}
                </span>
                {
                    this.props.children
                }
            </section>
        );
    }
}
